import React from 'react';
import DestinationContainer from '../containers/DestinationContainer';
import styles from '../Global';

const Home = () => {
  return (
    <div className={`${styles.section} ${styles.flexWrap} ${styles.bgGradient}`}>
      <h1 className={`${styles.h1Text} ${styles.textLeft}`}>
        Inicio
      </h1>
      <DestinationContainer />
    </div>
  );
};

export default Home;
